const mongoose = require("mongoose");
const Category = require("./category");

async function getCategoryIdByName(categoryName) {
    try {
        const category = await Category.findOne({ name: categoryName });
        if (category) {
            return category._id;
        } else {
            return null;
        }
    } catch (error) {
        console.error("product model fail at getCategoryIDbyName");
        return null;
    }
}

// Product model
const productSchema = new mongoose.Schema({
    barcode: {
        type: String,
        required: true,
        unique: true,
    },
    name: {
        type: String,
        required: true,
    },
    images: {
        type: String,
        required: true,
    },
    originalPrice: {
        type: Number,
        required: true,
    },
    salePrice: Number,
    categoryName: String,
    category: {
        type: mongoose.Schema.Types.ObjectId,
        ref: "Category"
    },
    dateCreated: {
        type: Date,
        default: Date.now,
    },
    qty: Number,
    sold: {
        type: Number,
        default: 0
    },
});

const Product = mongoose.model("Product", productSchema);

